    function _setLog(...args) {
        if (!debug) return;
        const prefix = "%c" + GM_info.script.name + " - " + GM_info.script.version + "\n";
        const stylePrefix = "color: rgba(255, 0, 0, 0.5);";

        if (typeof args[0] === 'string') console.error(prefix + "%c" + args[0], stylePrefix, "color: rgb(255, 0, 0);font-weight: bold;", ...args.slice(1));
        else console.error(prefix, stylePrefix, ...args);
    }

    function _inPoly(point, vs, mode = "some") {
        if (!del_onlyArea) return true;

        const isPoint = !Array.isArray(point[0]);
        if (!isPoint) {
            const bools = point.map((p) => _inPoly(p, vs, mode));
            return mode === "every" ? bools.every(Boolean) : bools.some(Boolean);
        }
        const x = point[0], y = point[1];
        let inside = false;
        for (let i = 0, j = vs.length - 1; i < vs.length; j = i++) {
            const xi = vs[i][0], yi = vs[i][1], xj = vs[j][0], yj = vs[j][1];
            const intersect = yi > y !== yj > y && x < ((xj - xi) * (y - yi)) / (yj - yi) + xi;
            if (intersect) inside = !inside;
        }
        return inside;
    }

    function _SetWebRequest(url) {
        const uuid = crypto.randomUUID();
        _setLog("‚û°Ô∏èüåê Requ√™te web " + uuid + " : ", url);

        return new Promise((resolve, reject) => {
            GM_xmlhttpRequest({
                method: "GET",
                url: url,
                onload: function (response) {
                    if (response.status === 200) {
                        try {
                            const json = JSON.parse(response.responseText);
                            _setLog("üåê‚û°Ô∏è R√©ponse web " + uuid + " : ", json);
                            resolve(json);
                        } catch (e) {
                            reject(e);
                        }
                    } else {
                        _setLog("üåê‚ùå Erreur " + uuid + " : ", response.status);
                        reject(response.status);
                    }
                },
                onerror: function (err) {
                    _setLog("üåê‚ùå Erreur " + uuid + " : ", err);
                    reject(err);
                }
            });
        });
    }

    async function _GetWorldLocation() {
        const uuid = crypto.randomUUID();
        _setLog("üåçüìç R√©cup√©ration les infos de la localisation " + uuid);

        const url = `https://data.geopf.fr/geocodage/reverse?lon=${wmeMap.mapCenter.lon}&lat=${wmeMap.mapCenter.lat}&index={index}&limit=4&category=administratif`;
        let currentLoc = {}, data;

        // R√©cup√©ration des POI
        data = await _SetWebRequest(url.replace("{index}", "poi"));
        data.features.forEach(f => {
            const p = f.properties, cats = p.category || [];
            if (cats.includes("commune")) currentLoc.city = { code: p.citycode?.[0] || null, name: p.toponym || p.name?.[0] || null, postcode: p.postcode?.[0] || null };
            if (cats.includes("d√©partement")) currentLoc.department = { code: p.citycode?.[0] || null, name: p.toponym || p.name?.[0] || null };
            if (cats.includes("r√©gion")) currentLoc.region = { code: p.citycode?.[0] || null, name: p.toponym || p.name?.[0] || null };
        });

        // R√©cup√©ration de l'adresse
        data = await _SetWebRequest(url.replace("{index}", "address"));
        data = data.features[0]?.properties;
        currentLoc.street = { housenumber: data?.housenumber, name: data?.street };

        _setLog("üåçüìç Localisation " + uuid + " : ", currentLoc);
        return currentLoc;
    }
