    function showNotes(categories) {
        currentCategory = categories;
        const noteList = $sel("#noteList");
        if (!noteList) return setTimeout(() => showNotes(categories), 500);
        $all(".noteContent").forEach((n) => n.remove());
        let notes = JSON.parse(GM_getValue("notes", "[]"));
        notes.forEach((n) => {
            // cat√©gorie r√©elle (si vide ou invalide ‚Üí "autre")
            let categorie = n.categorie || "autre";
            if (categorie !== "faire" && categorie !== "surv") categorie = "autre";

            // si la note n'est pas dans la cat√©gorie choisie ‚Üí on saute
            if (categorie !== categories) return;

            // --- formateurs de date ---
            function formatDate() {
                let date = new Date(n.date);
                const dateFormatter = new Intl.DateTimeFormat("fr-FR", { day: "numeric", month: "long", year: "numeric" });
                const timeFormatter = new Intl.DateTimeFormat("fr-FR", { hour: "2-digit", minute: "2-digit" });
                return `${dateFormatter.format(date)} ${timeFormatter.format(date)}`;
            }

            function timeAgo() {
                const seconds = Math.floor((Date.now() - n.date) / 1000);

                if (seconds < 60) return `${seconds} sec`;
                const minutes = Math.floor(seconds / 60);
                if (minutes < 60) return `${minutes} min`;
                const hours = Math.floor(minutes / 60);
                if (hours < 24) return `${hours} heure${hours > 1 ? "s" : ""}`;
                const days = Math.floor(hours / 24);
                if (days < 30) return `${days} jour${days > 1 ? "s" : ""}`;
                const months = Math.floor(days / 30);
                if (months < 12) return `${months} mois`;
                const years = Math.floor(days / 365);
                return `${years} an${years > 1 ? "s" : ""}`;
            }

            // --- construction DOM ---
            const noteContent = document.createElement("div");
            noteContent.className = "noteContent";
            noteContent.style.display = "flex";
            noteContent.style.justifyContent = "space-between";
            noteContent.style.alignItems = "center";
            noteContent.style.borderBottom = "1px solid #e1e1e1ff";
            noteContent.style.padding = "10px";
            noteContent.id = "note_" + n.id;
            noteContent.innerHTML = `
                    <div>
                        <span>${n.content}</span>
                        <br>
                            <i style="color:#aaa">${formatDate()} - ${timeAgo()}</i>
                    </div>
                    <i class="w-icon w-icon-recenter" id="noteCoords_${n.id}" style="cursor:pointer;"></i>
                    `;
            noteList.appendChild(noteContent);

            // clic pour recentrer la carte
            let noteCoords = $sel("#noteCoords_" + n.id);
            noteCoords.addEventListener("click", () => { wmeSDK.Map.setMapCenter({ lonLat: n.position, zoomLevel: n.zoom }); });
        });
        enableCustomContextMenu();
    }

