    function saveNotes(type, contentOrId, coords) {
        let notes = JSON.parse(GM_getValue("notes", "[]"));
        if (type === "add") {
            let newId;
            if (notes.length === 0) newId = "0001";
            else {
                let lastId = notes[notes.length - 1].id;
                let num = parseInt(lastId, 10) + 1;
                newId = num.toString().padStart(4, "0");
            }

            let newNote = {
                id: newId,
                content: contentOrId,
                zoom: wmeMap.zoomLevel,
                position: wmeMap.mapCenter,
                date: new Date().getTime(),
                categorie: currentCategory || "autre"
            };

            notes.push(newNote);
            GM_setValue("notes", JSON.stringify(notes));
        } else if (type === "del") {
            const idToDelete = contentOrId.replace("note_", "");
            notes = notes.filter((n) => n.id !== idToDelete);
            GM_setValue("notes", JSON.stringify(notes));
        } else if (type === "edit") {
            const idToEdit = contentOrId.replace("note_", "");
            let note = notes.find((n) => n.id === idToEdit);

            if (note) {
                const newNoteContent = window.prompt("Modifiez la note existante :", note.content);
                if (newNoteContent !== null) { note.content = newNoteContent; GM_setValue("notes", JSON.stringify(notes)); }
            }
        }
        // on rappelle showNotes avec la cat√©gorie active
        showNotes(currentCategory || "autre");
    }

