    function normalize(data) {
        let s = String(data || "");
        const regex = /\(([^)]+)\)/;
        const match = regex.exec(s);
        if (match) s = match[1];
        s = s.replace(/≈ì/g, "oe").replace(/≈í/g, "oe");
        return s.normalize("NFD").replace(/[\u0300-\u036f]/g, "").replace(/\s+/g, "").toLowerCase();
    }

