    function getAddressInExtend(type) {
        if (wmeMap.zoomLevel < 18) return;
        const poly = {
            type: "Polygon",
            coordinates: [
                [
                    [wmeMap.mapExtent.left, wmeMap.mapExtent.bottom],
                    [wmeMap.mapExtent.right, wmeMap.mapExtent.bottom],
                    [wmeMap.mapExtent.right, wmeMap.mapExtent.top],
                    [wmeMap.mapExtent.left, wmeMap.mapExtent.top],
                    [wmeMap.mapExtent.left, wmeMap.mapExtent.bottom],
                ],
            ],
        };
        const params = new URLSearchParams({
            searchgeom: JSON.stringify(poly),
            index: "address",
            type: "housenumber",
            limit: "50",
            returntruegeometry: "false",
        });
        GM_xmlhttpRequest({
            method: "GET",
            url: `https://data.geopf.fr/geocodage/reverse?${params}`,
            onload: (response) => {
                if (response.status === 200) {
                    const data = JSON.parse(response.responseText);
                    removeLayer();
                    checkStreet();
                    addLayer(data, type);
                }
            },
        });
    }

    async function addLayer(data, type) {
        removeLayer();
        const currentHNKeys = new Set(
            currentHN.map(({ number, street, city }) => `${normalize(number)}|` + `${normalize(street)}|` + `${normalize(city)}`)
        );

        const currentLoc = await _GetWorldLocation();
        const streetCurrNorm = normalize(currentLoc.street.name);
        const vectorLayer = new OpenLayers.Layer.Vector("address_layer");
        const polygonPoints = [];
        let pointStyle = {
            pointRadius: 5,
            fillOpacity: 0.5,
            strokeColor: "#ffffff",
            strokeWidth: 2,
            fontSize: "12px",
            fontWeight: "bold",
            labelAlign: "cm",
            labelYOffset: -20,
            labelOutlineWidth: 3
        };

        let loadAddress = 0;
        data.features.forEach((f) => {
            loadAddress += 1;
            const [lon, lat] = f.geometry.coordinates;
            const props = f.properties || {};
            const hn = props.housenumber || props.name || "";
            const st = props.street || props.name || "";
            const ct = props.city || "";
            const key = `${normalize(hn)}|` + `${normalize(st)}|` + `${normalize(ct)}`;
            const isIncurrentHN = currentHNKeys.has(key);
            isCurrentStreet = streetCurrNorm === normalize(st);
            const label = `${hn.toLowerCase()} ${st}\n${ct}`.trim();
            const lonLat = new OpenLayers.LonLat(lon, lat).transform(new OpenLayers.Projection("EPSG:4326"), W.map.getProjectionObject());
            pointStyle = {
                ...pointStyle,
                label,
                fillColor: isIncurrentHN ? "#00ff00" : "#ff0000",
                fontColor: isIncurrentHN ? "#00af00" : "#ff0000",
                labelOutlineColor: (hlStreet && isCurrentStreet) ? "#f0f0f0" : "#191919",
            };
            vectorLayer.addFeatures([new OpenLayers.Feature.Vector(new OpenLayers.Geometry.Point(lonLat.lon, lonLat.lat), {}, pointStyle),]);

            if (isCurrentStreet && polyStreet) polygonPoints.push(new OpenLayers.Geometry.Point(lonLat.lon, lonLat.lat));

            try {
                if ((autoAddRpp || autoAddHn) && !isIncurrentHN) {
                    if (addAddressOnArea) {
                        if (_inPoly(f.geometry.coordinates,
                            wmeSDK.DataModel.MapComments.getById({
                                mapCommentId: wmeSDK.Editing.getSelection().ids[0].toString(),
                            }).geometry.coordinates[0]
                        )) getCenterRnb("", lon, lat, props.housenumber, props.street, props.city);
                    } else getCenterRnb("", lon, lat, props.housenumber, props.street, props.city);
                }

                if (type && !isIncurrentHN) {
                    if (addAddressOnArea) {
                        if (
                            _inPoly(
                                f.geometry.coordinates,
                                wmeSDK.DataModel.MapComments.getById({
                                    mapCommentId: wmeSDK.Editing.getSelection().ids[0].toString(),
                                }).geometry.coordinates[0]
                            )
                        ) getCenterRnb(type, lon, lat, props.housenumber, props.street, props.city);
                    } else getCenterRnb(type, lon, lat, props.housenumber, props.street, props.city);
                }
            } catch ($) { };
        });

        const loadAddressHTML = $id("load-address");
        loadAddressHTML.innerHTML = `Adresses affich√©es: ${loadAddress}`;

        if (polygonPoints.length > 2) {
            const centroid = {
                x: polygonPoints.reduce((s, p) => s + p.x, 0) / polygonPoints.length,
                y: polygonPoints.reduce((s, p) => s + p.y, 0) / polygonPoints.length
            };
            polygonPoints.sort((a, b) => {
                const angA = Math.atan2(a.y - centroid.y, a.x - centroid.x);
                const angB = Math.atan2(b.y - centroid.y, b.x - centroid.x);
                return angA - angB;
            });
            const ring = new OpenLayers.Geometry.LinearRing(polygonPoints);
            const poly = new OpenLayers.Geometry.Polygon([ring]);
            const polyStyle = {
                strokeColor: "#0000ff", strokeWidth: 2,
                fillColor: "#0000ff", fillOpacity: 0.15
            };
            vectorLayer.addFeatures([new OpenLayers.Feature.Vector(poly, {}, polyStyle)]);
        }

        W.map.addLayer(vectorLayer);
    }

