    function displayParcels(parcels) {
        clearLayer();
        if (!pointLayer) {
            const styleMap = new OpenLayers.StyleMap({
                default: new OpenLayers.Style({
                    fillColor: "green",
                    fillOpacity: 0.4,
                    strokeColor: "red",
                    strokeWidth: 2,
                }),
            });
            pointLayer = new OpenLayers.Layer.Vector("Custom Cadastre Layer", { styleMap });
            W.map.addLayer(pointLayer);
        }

        parcels.forEach((feature) => {
            const geometry = feature.geometry;
            const type = geometry.type;
            const coordinates = geometry.coordinates;

            // Fonction pour ajouter un polygone √† partir des coordonn√©es
            const addPolygon = (coords) => {
                const points = coords.map(([lng, lat]) => {
                    const point = new OpenLayers.Geometry.Point(lng, lat).transform("EPSG:4326", "EPSG:3857"); return [point.x, point.y];
                });

                const linearRing = new OpenLayers.Geometry.LinearRing(points.map(([x, y]) => new OpenLayers.Geometry.Point(x, y)));
                const polygonFeature = new OpenLayers.Feature.Vector(new OpenLayers.Geometry.Polygon([linearRing]));
                pointLayer.addFeatures([polygonFeature]);

                // Ajout des points noirs
                points.forEach(([x, y]) => {
                    const pointFeature = new OpenLayers.Feature.Vector(
                        new OpenLayers.Geometry.Point(x, y), {},
                        {
                            fillColor: "black", // Point noir
                            strokeColor: "black",
                            pointRadius: 3,
                            fillOpacity: 1.0,
                        }
                    ); pointLayer.addFeatures([pointFeature]);
                });
            };

            if (type === "Polygon") coordinates.forEach((ring) => addPolygon(ring));
            else if (type === "MultiPolygon") {
                coordinates.forEach((polygon) => {
                    polygon.forEach((ring) => addPolygon(ring));
                });
            }
        });

        togglePolygonVisibility();
    }

    function applyStyles() {
        console.log("applyStyles d√©clench√©");
        const fillColor = $id("fillColor").value;
        const fillOpacity = parseFloat($id("fillOpacity").value);
        const strokeColor = $id("strokeColor").value;
        const strokeWidth = parseInt($id("strokeWidth").value, 10);
        const pointSize = parseInt($id("pointSize").value, 10);
        updateLayerStyle(fillColor, fillOpacity, strokeColor, strokeWidth, pointSize);
    }

    function updateLayerStyle(fillColor, fillOpacity, strokeColor, strokeWidth, pointSize,) {
        if (!pointLayer) return;

        // Appliquer les nouveaux styles
        const updatedStyleMap = new OpenLayers.StyleMap({
            default: new OpenLayers.Style({
                fillColor: fillColor || "green",
                fillOpacity: fillOpacity !== undefined ? fillOpacity : 0.4,
                strokeColor: strokeColor || "red",
                strokeWidth: strokeWidth || 2,
                pointRadius: pointSize || 8,
            }),
        });
        pointLayer.styleMap = updatedStyleMap;
        pointLayer.redraw(); // Redessine la couche pour appliquer les nouveaux styles
    }

    function setConnectionLines() {
        if (!ui_lines) return;

        let hn = [];

        // Venues
        wmeSDK.DataModel.Venues.getAll().forEach(v => {
            if (
                !v.navigationPoints ||
                !v.navigationPoints.length ||
                !v.navigationPoints[0].point ||
                !v.navigationPoints[0].point.coordinates
            ) return;

            hn.push({
                lon: v.geometry.coordinates[0],
                lat: v.geometry.coordinates[1],
                fpLon: v.navigationPoints[0].point.coordinates[0],
                fpLat: v.navigationPoints[0].point.coordinates[1],
                isForced: false
            });
        });

        // House Numbers
        wmeSDK.DataModel.HouseNumbers
            .fetchHouseNumbers({
                segmentIds: wmeSDK.DataModel.Segments.getAll().map(s => s.id)
            })
            .then(list => {

                list.forEach(h => {
                    if (
                        !h.fractionPoint ||
                        !h.fractionPoint.coordinates
                    ) return;

                    hn.push({
                        lon: h.geometry.coordinates[0],
                        lat: h.geometry.coordinates[1],
                        fpLon: h.fractionPoint.coordinates[0],
                        fpLat: h.fractionPoint.coordinates[1],
                        isForced: h.isForced === true
                    });
                });

                const layerLines = new OpenLayers.Layer.Vector("zux_lines", {
                    styleMap: new OpenLayers.StyleMap(
                        new OpenLayers.Style(
                            {
                                strokeWidth: 2,
                                strokeOpacity: 1,
                                strokeDashstyle: "dash",
                                strokeColor: "${getColor}"
                            },
                            {
                                context: {
                                    getColor: function (feature) {
                                        return feature.attributes.isForced ? "red" : "white";
                                    }
                                }
                            }
                        )
                    )
                });

                hn.forEach(p => {
                    if (
                        p.lon == null || p.lat == null ||
                        p.fpLon == null || p.fpLat == null
                    ) return;

                    layerLines.addFeatures(
                        new OpenLayers.Feature.Vector(
                            new OpenLayers.Geometry.LineString([
                                new OpenLayers.Geometry.Point(p.lon, p.lat)
                                    .transform("EPSG:4326", W.map.getProjectionObject()),
                                new OpenLayers.Geometry.Point(p.fpLon, p.fpLat)
                                    .transform("EPSG:4326", W.map.getProjectionObject())
                            ]),
                            {
                                isForced: p.isForced
                            }
                        )
                    );
                });

                W.map.getLayersByName("zux_lines").forEach(l => W.map.removeLayer(l));
                W.map.addLayer(layerLines);
            });
    }
